def visualize_matrix(matrix):
    # Get the number of rows and columns in the matrix
    rows = len(matrix)
    cols = len(matrix[0])

    # Create a string to represent the matrix visually
    matrix_str = ""

    # Iterate through the rows and columns of the matrix
    for i in range(rows):
        for j in range(cols):
            # Append the value at the current position to the string
            matrix_str += str(matrix[i][j]) + " "
        # Add a newline character at the end of each row
        matrix_str += "\n"

    # Print the visual representation of the matrix
    print(matrix_str)

